INSERT INTO `blogs` VALUES (1,'EfA is Launching an Exciting CPD Solution Next Week! Watch this Space!','We are delighted to announce that our highly anticipated launch is just around the corner. Next week, we will be unveiling a new teacher training service that will revolutionize the way educators enhance their skills and enrich their classrooms.\n\nThe service has at its heart two principles that are absent from most teacher trainer initiatives: flexibility and choice. Teachers who sign up for the service will have a hand in both the design and implementation of the training, both for themselves and for all the other teachers who join.\n\n\nThe first 15 people to join will receive a free gift! \n\nSo stay tuned for the big reveal, as we will be sharing more details, exclusive offers, and how you can be among the first to experience this groundbreaking teacher training. \n\nKeep an eye on our website and get ready to join us in shaping the future of education!\n\nFor more information about our other teacher training courses, contact us: at admin@englishforafrica.net, or +212680542220.','ef-a-is-launching-an-exciting-cpd-solution-next-week-watch-this-space','2023-06-01 13:15:03.678000','2023-06-03 15:00:41.006000','2023-06-01 13:15:13.703000',1,2),(2,'Online Professional Development Service','For the first time, English for Africa (EfA) is offering a fully online professional development subscription service as a part of its Continuous Professional Development (CPD) program for English language teachers.\n\n\nOur online subscription format is designed to be flexible and convenient for teachers and institutions everywhere who want to pick and choose the types of professional development they engage in, and who place a premium on learner autonomy. EFA’s CELTA & DELTA trainers, who will host the online workshops & webinars, will be available to answer all your questions this year—so there’s no time to lose! \n\n\nWhat is the Online Professional Development Program? \n\nWe are offering a cost-effective way to build up your confidence, reinforce your skills, and become equipped with internationally recognized and updated teaching methodologies. Whether you are a new teacher or have years of experience, the program is ideal for those aiming to enrich their teaching knowledge and enhance the classroom experience for themselves and for their students. \n\n\nThe program has two major components: \n\n\nOnline workshops. This is a series of teacher development workshops that will increase your knowledge and skills in specific areas of English language teaching. Topics will range widely, from practical classroom management and lesson planning issues (teaching very young learners, exam classes, alternative approaches to lesson planning) to broader, transversal issues (ChatGPT in the classroom, cultural inclusion, and diversity, etc.), and will be chosen in collaboration with all course subscribers via a survey system—you, the subscriber, decide what you want to learn.\n\n\nA platform for collaborative development initiatives. This is a platform where we will share valuable teaching and teacher training resources, and support you as you create autonomous PLNs (professional learning networks) and SIGs (special interest groups) to help you work towards self-set professional development goals. The aim is to provide a space where teachers who are interested in their own professional development can work together to study, research, and develop specific topics, teaching skills, and techniques that they are interested in. We will also create a repository for lesson plans uploaded by our subscribers, and provide access to an online library of methodology and course books. Teaching is a notoriously solitary profession—this initiative aims to make it vastly less so.\n\n\nWhy subscribe to Online Professional Development Program? \n\nAnnual & monthly Subscription \n\nA Series of online workshops and webinars\n\nUser choice\n\n Highly-qualified speakers \n\n Valuable resources\n\n A space and tools for mutual support, research, and collaboration \n\n Certificates of attendance \n\n Weekends ONLY\n\n Invitation to write articles on EfA\'s blog.  \n\n Monthly Newsletter \n\n\nWhat do you need to subscribe? \n\nHave a minimum of a B1 level or above in English.\n\nHave a stable internet connection. \n\n\nHow many Workshops/Webinars are Hosted Every Month? \n\nEfA offers from one to two workshops/webinars monthly according to the needs of the program subscribers. \n\n\nWhat is the Duration of each Workshop/Webinar? \n\nThe duration is 150 minutes. \n\n\nWhat ELT topics are covered during the subscription? \n\nDifferent ELT topics are discussed, such as teaching exam classes, YLs, teaching teens, using AI in the classroom, inclusion and diversity in materials and approaches, problem-based learning, teaching business English and English for specific purposes, Dogme language teaching, etc.  \n\n\nCan teachers suggest topics to be covered by the trainers?\n\nEFA’s experience and expertise in teacher training will inform our choice of topics to be covered in our workshops, but that same experience and expertise have opened our eyes to the fact that it is often the classroom teachers at the front lines who have the strongest awareness of what their own needs are. We will, therefore, eagerly accept suggestions for upcoming webinars and workshops, and run them if sufficient interest is expressed by program enrollees.\n\n\nHow much does the subscription cost? \n\n50 $ when you choose an annual plan and  15$ when you choose a monthly one.\n\n\nIs there a special offer for institutions that enroll their teachers?\n\nEFA’s goal is to improve language teaching in Africa and beyond and will consider offers of partnership from institutions willing to make high-quality teacher training available to their staff.\n\n\nDo subscribers receive a certificate? \nEach subscriber receives a certificate of attendance for each workshop/webinar.   \n\nFor more information, contact us: at admin@englishforafrica.net, or +212680542220','online-professional-development-service','2023-06-01 14:03:43.850000','2023-06-03 14:58:18.257000','2023-06-01 14:31:13.839000',1,2),(3,'Our face-to-face CELTA course in Casablanca this July might be the perfect opportunity for you!','The CELTA (Certificate in Teaching English to Speakers of Other Languages) is a globally recognized qualification for those who want to teach English as a foreign language. It is offered in both face-to-face and online formats. In this blog post, we will be focusing on the face-to-face CELTA course.\n\nWhat is the face-to-face CELTA course?\nThe face-to-face CELTA course is a full-time course that typically lasts four weeks. It is an intensive course designed to provide trainees with the practical skills and knowledge needed to teach English to non-native speakers.\n\nDuring the course, trainees will learn about teaching methodologies, lesson planning, classroom management, and language analysis. They will also have the opportunity to observe experienced teachers and teach their own classes under the supervision of a qualified tutor.\n\n\nWhy choose our face-to-face CELTA course in Casablanca?\nOur face-to-face CELTA course offers a dynamic and interactive learning experience. You will have the opportunity to interact with other trainees and experienced teachers and receive immediate feedback on your teaching practice.\n\n\nThe course is also highly practical, with a strong focus on hands-on teaching experience. You will have the opportunity to teach in a real classroom, receive feedback from your tutor and peers, and reflect on your teaching practice.\n\n\nAnother benefit of our face-to-face CELTA course in Casablanca is the location. Casablanca is the largest city in Morocco, located on the Atlantic coast in the western part of the country. It is the economic and commercial center of Morocco. Casablanca is a dynamic and cosmopolitan city that offers a rich cultural experience for visitors. Its blend of modernity and tradition, combined with its beautiful architecture and rich history, make it a must-visit destination for anyone traveling to Morocco.\n\n\nIs the face-to-face CELTA course right for you?\n\nOur face-to-face CELTA course is ideal for those who are looking for an intensive, immersive, and practical learning experience. It is particularly suitable for those who are new to teaching English as a foreign language or teachers who already have experience and are seeking to enhance or validate their skills by obtaining an internationally recognized certificate. \n\n\nHowever, the course can be challenging, with long hours and a heavy workload. It is important to be prepared to work hard and manage your time effectively in order to succeed.\n\n\n\nIn conclusion, if you are looking to gain a globally recognized teaching qualification and improve your teaching skills, then our face-to-face CELTA course in Casablanca this July might be the perfect opportunity for you. With a dynamic and interactive learning experience, practical teaching experience, and the opportunity to immerse yourself in a new culture, it can be a transformative experience that will set you on the path to a successful career in teaching English as a foreign language.\n\n\nFor more information about the CELTA or our other teacher training courses, contact us: at admin@englishforafrica.net, or +212680542220.','our-face-to-face-celta-course-in-casablanca-this-july-might-be-the-perfect-opportunity-for-you','2023-06-02 10:01:08.452000','2023-06-03 14:52:10.426000','2023-06-02 10:08:54.829000',2,2),(4,'Join our Cambridge How to Teach IELTS Course','How to Teach IELTS (32-hour online teacher development course) \n\nFor the first time in Morocco, EfA will offer a fully online course for teaching IELTS. Upgrade your teaching skills and knowledge with our four-week course.\n\n\nBy the end of the course, candidates will have learned how to teach IELTS preparation classes, and will receive an official IELTS Trainer Certificate from Cambridge University.\n\n\nWhat is How to teach IELTS Course? \n\nThe 32-hour fully online course helps teachers understand IELTS thoroughly and allows learners to approach the exam confidently and use practical strategies and activities to prepare learners for the exam successfully. This course explains and showcases techniques on how to teach all four papers, including Academic and General Training options, and all sections. It provides teachers with tools to help apply the tehcniques in the classroom, and practical ideas that help learners perform at their best.\n\n\nThe course is composed of the following two components:\n\nCambridge LMS (20 hours): You will first explore what it means to be good at the skills IELTS targets, before learning about how each paper is assessed, the types of tasks learners can expect, and strategies for each of those tasks.  \n\n\nLive input sessions (12 hours): four three-hour live input sessions, each of which covers one paper of the exam (both versions of the exam, Academic and General):  \n\n             Session 1 - How to Teach Listening   \n             Session 2 - How to Teach Reading  \n             Session 3 - How to Teach Writing  \n             Session 4 - How to Teach Speaking  \n\n\nInput Sessions run by a Cambridge CELTA Tutor and IELTS Teacher Trainer \n\nEach input session tackles one of the papers on the exam, looking at both the Academic and General versions of the exam. These are hands-on sessions where the candidates experiment with activities meant to improve students’ performance on the exam. Each session includes the following:\n\n\nSample exam task done by candidates \n\nAnalysis of the exam task :\n\n                   Assessment criteria \n\n                   How to succeed at that task \n\nTechniques to help students improve their performance \n\nFun and interactive IELTS prep course tasks demonstrated on the candidates \n\n\nThe Cambridge IELTS LMS will be permanently decommissioned in the spring of 2023, so this is one of the last opportunities candidates will have to take this course.\n\n\nIs the How to Teach IELTS Course the Right Course for You?\n\n\nIf you are an experienced teacher who wants to start working in the growing field of IELTS test preparation courses, or if you want a refresher/further training on making IELTS preparation engaging and fun, How to teach IELTS is the course for you. This internationally accredited course will open the door to a plethora of opportunities in teaching IELTS and being an IELTS examiner. \n\n\nYou are eligible to take the course if you are at least 20 years of age, have a C1 level in English, and have at least one year of teaching experience.\n\n\nAn International Trainer for an International Course\n\nThe live input sessions are designed and run by Mohamed Samk. Samk hasmore than seven years of experience in Education field, He has taken on a number of challenging roles in his career, ranging from teaching, teacher training, and educational management. \n\n\nHe is a Cambridge CELTA and DELTA holder (specialization: ELT management). He is also a Cambridge-approved CELTA, CELT-P, and CELT-S Tutor. He has been training teachers on how to teach IELTS courses since 2020.','join-our-cambridge-how-to-teach-ielts-course','2023-06-02 10:02:33.002000','2023-06-03 14:53:17.318000','2023-06-02 10:08:49.672000',2,2),(5,'DELTA Module 1 Preparation Course','For the first time in Morocco, EfA will be offering a fully online preparation course for the first Module of the DELTA. Prepare for the DELTA Module 1 Exam with our ten-week prep course, and take the test at our center in June of this year.\n\n\n## **What is the DELTA?\n**\nThe DELTA is Cambridge’s Diploma-level course in teaching English to speakers of other languages. At OfQualLevel 7 (the official body for educational standards in England and Wales), the DELTA is considered in the UK to be a Masters\'s level course.\n\n\nYou are eligible to take the course if you are at least 20 years of age, have a C1 level in English, and have at least one year of teaching experience.\n\n\nThe three modules of the DELTA are assessed separately and can be taken in any order. Very often, though, people opt to take Module 1 first.\n\nModule 1 focuses on extending and developing candidates’ knowledge and understanding of teaching and learning English in a range of contexts. It is a paper-and-pen test administered at TQ centers. The test itself is offered only twice a year, at the beginning of June and the beginning of December.\n\n\nModule 2 focuses on developing awareness and expertise in the principles and professional practice of teaching English in a range of contexts. It can be taken at any time, both online or in person, and is assessed by means of 4 Language Systems and Skills and Assignments. Each assignment is accompanied by an observed and assessed lesson taught in the context of the candidate.\n\n\nModule 3 allows the candidate to explore a specific field of English language teaching in-depth and culminates in the submission of an assignment. There are two options for the format and content of the assignment:\n\nThe design of a course program that extends the practitioner’s expertise in a specialized area of ELT; \n\nA written project focusing on an aspect of ELT management, ranging from human resources management to marketing or customer service. \n\nIt often takes between 1 and 2 years to complete all three modules of the course.\n\n\nWhy Take the DELTA?\n\nIf you are an experienced teacher who wants to take your teaching to the next level, the DELTA is for you. It is an internationally recognized diploma that opens the door to opportunities in educational management, teacher training, and prestigious teaching positions worldwide.\n\n','delta-module-1-preparation-course','2023-06-02 10:03:51.529000','2023-06-03 15:04:42.148000','2023-06-02 10:08:44.766000',2,2),(6,'Transitioning from online to Face-to-face on a Mixed Mode CELTA Course','This input session was given halfway through a mixed-mode CELTA course, to help the candidates to transition from online teaching to face-to-face teaching. The focus of this excerpt is on classroom management, and in particular on how to distribute handouts in the classroom.\n\nFor more information about the CELTA or our other teacher training courses, contact us: at admin@englishforafrica.net, or +212680542220.\n\n','transitioning-from-online-to-face-to-face-on-a-mixed-mode-celta-course','2023-06-02 10:05:22.359000','2023-06-03 14:56:45.090000','2023-06-02 10:08:58.934000',2,2);
